import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import { useState, useEffect } from 'react';
import { red } from '@material-ui/core/colors';



const useStyles = makeStyles((theme) => ({
    //fame
    mainFame: {
        width: 933,
        height: 892,
        backgroundColor: '#FFFFFF',
        position: 'relative'
    },
    mainFameHeader: {
        height: 106,
        width: "100%",
        borderBottom: '1px solid #AAAAAA'
    },
    inFame: {
        width: 748,
        height: 380,
        position: 'relative',
        borderRadius: '5px',
        border: '1px solid #AAAAAA'

    },
    inFameHeader: {
        width: "100%",
        height: 107,
        borderBottom: '1px solid #AAAAAA',
        background: 'blue'

    },
    //row in fame
    rominfame: {
        width: '100%',
        height: 69
    },
    //wrap infame
    wrapfame: {
        width: 748,
        minHeight: 446,
        backgroundColor: 'red',
        margin: 'auto',
        position: 'relative'
    },
    //text
    title: {
        fontSize: '28px',
        color: '#4A4A4A',
        fontWeight: 'bold',
        position: 'absolute',
        top: 33,
        left: 52
    },
    title2: {
        fontSize: '24px',
        color: '#4A4A4A',
        fontWeight: 'bold',
        position: 'absolute',
    },
    title3: {
        fontSize: '20px',
        color: '#4A4A4A',
        fontWeight: 'bold'
    },
    title4: {
        fontSize: '16px',
        color: '#4A4A4A',
        fontWeight: 'bold'
    },
    title5: {
        fontSize: '16px',
        color: '#4A4A4A',
    },

    //input
    inputSize: {
        height: 39,
        width: 234,
        fontSize: '16px',
        color: '#4A4A4A',
    },

    //button
    buttonDelete: {
        width: 35,
        height: 35
    },


    //decor
    decorLeftRight: {
        width: 51
    },


}));

export default function CreateRoomRe() {
    const classes = useStyles();


    return (
        <div style={{ position: 'absolute', top: 40 }}>

            <div className={classes.mainFame}>

                <div className={classes.mainFameHeader}>

                    <div className={classes.title}>
                        Rooms
                    </div>

                </div>






                <div className={classes.wrapfame}>

                    <div style={{ position: 'relative', height: 76 }}>
                        <div className={classes.title2} style={{ position: 'relative', top: 20 }}>
                            Building Name props
                        </div>
                    </div>
                    {/* map floor here*/}

                    <div className={classes.inFame}>
                        {/* //linedivider */}



                        <div className={classes.inFameHeader}>
                            <div className={classes.title3}>
                                Floor Number props
                            </div>

                            {/* display flex */}
                            <div style={{ display: 'flex' }}>
                                <div className={classes.title4}>
                                    Room
                                </div>
                                <div className={classes.title4}>
                                    Edit Name Room
                                </div>
                                <div className={classes.title4}>
                                    Delete
                                </div>
                            </div>
                        </div>



                        {/* map room here */}
                        <div className={classes.rominfame}>
                            {/* display flex */}
                            <div style={{ display: 'flex' }}>
                                <div className={classes.title5}>
                                    props 101
                                </div>
                                <input className={classes.inputSize}>

                                </input>
                                <div className={classes.buttonDelete}>
                                    {/* button delete here */}
                                </div>
                            </div>
                        </div>

                    </div>
                </div>






            </div>
        </div>
    )
}
